(188, 'info', 'title = \"Movie single\"\nurl = \"/movies/movie/:slug\"\nlayout = \"default\"\nis_hidden = 0\n\n[builderDetails]\nmodelClass = \"momo\\Movies\\Models\\Movie\"\nidentifierValue = \"{{ :slug }}\"\nmodelKeyColumn = \"slug\"\ndisplayColumn = \"name\"\nnotFoundMessage = \"Record not found\"\n==\n{% set record = builderDetails.record %}\r\n{% set displayColumn = builderDetails.displayColumn %}\r\n{% set notFoundMessage = builderDetails.notFoundMessage %}\r\n\r\n{% if record %}\r\n\r\n<h2>{{ record.name }}</h2>\r\n\r\n<img src=\"{{record.poster.thumb(200,auto) }}\">\r\n\r\n<h4>{{ record.year }}</h4>\r\n\r\n<h3>Genres</h3>\r\n{% for genre in record.genres %}\r\n{{genre.genre_title}}</br>\r\n{% endfor %}\r\n\r\n\r\n<h3>Description</h3>\r\n\r\n{{ record.description|raw }}\r\n\r\n<ul class=\"gallery clearfix\">\r\n    {% for image in record.movie_gallery %}\r\n    <li>\r\n        <a href=\"{{image.path}}\">\r\n            <img src=\"{{image.thumb(80,80,{\'mode\':\'crop\'}) }}\">\r\n        </a>\r\n    </li>\r\n    {% endfor %}\r\n</ul>\r\n\r\n{% else %}\r\n{{ notFoundMessage }}\r\n{% endif %}', NULL, '2018-05-09 23:42:48', '2018-05-09 23:42:48'),
